import React from "react";
import './App.css';
import ResourceUsageBar from './ResourceUsageBar';
import ServicesSection from './ServicesSection';

function App() {
  return (
    <div id="main-container">
      <ResourceUsageBar />
      <ServicesSection />
    </div>
  );
}

export default App;
